import { Container, Grid,Paper,Box, Typography} from '@mui/material';
import React from 'react';
import { styled } from '@mui/material/styles';
import doctor from '../../../images/doctor.png';
import bg from '../../../images/appointment-bg.png';

import { green, grey } from '@mui/material/colors';
import { dark } from '@mui/material/styles/createPalette';
// import Paper from '@mui/material/Paper';



const AppointmentBanner = () => {
  const AppointmentBannerBg={
    backgroundColor: 'green',
    backgroundImage: `url(${bg})`,
    marginTop: '100px'
    }
    return (
        <Box style={AppointmentBannerBg} sx={{ flexGrow: 1 }}>
          <Grid container spacing={2}>
            <Grid item xs={12} md={6}>
              <img style={{
                width:400,
                marginTop
              }} src={doctor} alt="" />
            </Grid>
            <Grid item xs={12} md={6}>
              <Typography variant="h6"> Appoinment </Typography>
              <Typography variant="h6"> Make an appointment toiday </Typography>
              <Typography variant="h6">It it am matter of fact thet yo are reading tghis.</Typography>
            </Grid>
          </Grid>
        </Box>
    );
};

export default AppointmentBanner;
